import styled from 'styled-components';

const IndexImageStyles = styled.div`
  h1 {
    text-align: center;
    color: rgb(230, 250, 250);
    text-transform: uppercase;
    font-family: Arial, Helvetica, sans-serif;
    font-size: 120px;
    background-color: rgba(0, 0, 15, 0.3);
    font-style: italic;
    margin-top: 10vh;
    text-shadow: black 5px 5px;
  }

  #hoodies {
    background-image: url(/hoodies.jpg);
    background-size: cover;
    background-repeat: no-repeat;
    background-position: center;
    position: absolute;
    height: 100%;
    width: 100%;
  }

  #dresses {
    background-image: url(/dresses.jpg);
    background-size: cover;
    background-repeat: no-repeat;
    background-position: center;
    position: absolute;
    height: 100%;
    width: 100%;
  }

  #footwear {
    background-image: url(/footwear.jpg);
    background-size: cover;
    background-repeat: no-repeat;
    background-position: center;
    position: absolute;
    height: 100%;
    width: 100%;
  }

  #shirts {
    background-image: url(/shirts.jpg);
    background-size: cover;
    background-repeat: no-repeat;
    background-position: center;
    position: absolute;
    height: 100%;
    width: 100%;
  }

  #kids {
    background-image: url(/kids.jpg);
    background-size: cover;
    background-repeat: no-repeat;
    background-position: center;
    position: absolute;
    height: 100%;
    width: 100%;
  }

  #accessories {
    background-image: url(/accessories.jpg);
    background-size: cover;
    background-repeat: no-repeat;
    background-position: center;
    position: absolute;
    height: 100%;
    width: 100%;
  }

  #female {
    background-image: url(/female.jpg);
    background-size: cover;
    background-repeat: no-repeat;
    background-position: center;
    position: absolute;
    height: 100%;
    width: 100%;
  }

  #male {
    background-image: url(/male.jpg);
    background-size: cover;
    background-repeat: no-repeat;
    background-position: center;
    position: absolute;
    height: 100%;
    width: 100%;
  }
`;

export default IndexImageStyles;
